import './App.css';
import {Route, Routes} from "react-router-dom"
import Header from './Coponents/Header';
import Home from './Coponents/Home';
import Footer from './Coponents/Footer';

function App() {
  return (
    <div className="App">
       <Header/>


      <Routes>
      <Route>
     <Home/>

      </Route>

      </Routes>

        <Footer/>


    </div>
  );
}

export default App;
